// changelog: updated to use version 0.7.4

pragma solidity 0.7.4;

contract CTokenStorage {
    /**
     * @notice EIP-20 token name for this token
     */
    string public name;

    /**
     * @notice EIP-20 token symbol for this token
     */
    string public symbol;

    /**
     * @notice EIP-20 token decimals for this token
     */
    uint8 public decimals;

    /**
     * @notice Contract which oversees inter-cToken operations
     */
    address public comptroller;

    /**
     * @notice Total number of tokens in circulation
     */
    uint public totalSupply;
}

abstract contract CToken is CTokenStorage {
    /**
     * @notice Indicator that this is a CToken contract (for inspection)
     */
    bool public constant isCToken = true;

    /**
     * @notice EIP20 Transfer event
     */
    event Transfer(address indexed from, address indexed to, uint amount);

    /**
     * @notice EIP20 Approval event
     */
    event Approval(address indexed owner, address indexed spender, uint amount);

    /**
     * @notice Failure event
     */
    event Failure(uint error, uint info, uint detail);


    /*** User Interface ***/

    function transfer(address dst, uint amount) external virtual returns (bool);
    function transferFrom(address src, address dst, uint amount) external virtual returns (bool);
    function approve(address spender, uint amount) external virtual returns (bool);
    function allowance(address owner, address spender) external virtual view returns (uint);
    function balanceOf(address owner) external virtual view returns (uint);
    function balanceOfUnderlying(address owner) external virtual returns (uint);
    function getAccountSnapshot(address account) external virtual view returns (uint, uint, uint, uint);
    function borrowRatePerBlock() external virtual view returns (uint);
    function supplyRatePerBlock() external virtual view returns (uint);
    function totalBorrowsCurrent() external virtual returns (uint);
    function borrowBalanceCurrent(address account) external virtual returns (uint);
    function borrowBalanceStored(address account) external virtual view returns (uint);
    function exchangeRateCurrent() external virtual returns (uint);
    function exchangeRateStored() external virtual view returns (uint);
    function getCash() external virtual view returns (uint);
    function accrueInterest() external virtual returns (uint);
    function seize(address liquidator, address borrower, uint seizeTokens) external virtual returns (uint);
}

abstract contract CErc20 is CToken {
    function underlying() external virtual view returns (address);
    function mint(uint mintAmount) external virtual returns (uint);
    function redeem(uint redeemTokens) external virtual returns (uint);
    function redeemUnderlying(uint redeemAmount) external virtual returns (uint);
    function borrow(uint borrowAmount) external virtual returns (uint);
    function repayBorrow(uint repayAmount) external virtual returns (uint);
    function repayBorrowBehalf(address borrower, uint repayAmount) external virtual returns (uint);
    function liquidateBorrow(address borrower, uint repayAmount, CToken cTokenCollateral) external virtual returns (uint);
}

abstract contract CEther is CToken {
    function mint() external virtual payable;
    function redeem(uint redeemTokens) external virtual returns (uint);
    function redeemUnderlying(uint redeemAmount) external virtual returns (uint);
    function borrow(uint borrowAmount) external virtual returns (uint);
    function repayBorrow() external virtual payable;
    function repayBorrowBehalf(address borrower) external virtual payable;
    function liquidateBorrow(address borrower, CToken cTokenCollateral) external virtual payable;
}"
    },
    "contracts/CompoundVars.sol": {
      "content": "// SPDX-License-Identifier: LGPL-3.0-or-later
pragma solidity 0.7.4;

import "./compound/CToken.sol";
import "./compound/Comptroller.sol";
import "./Interfaces.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

/// @dev This contract holds the addresses and information related
/// to all the relevant contracts.
/// @dev This contract should be used by all other contracts to get
/// the latest contract address information.
/// @dev This contract serves as the single source of truth for all
/// kCompound contracts.
contract CompoundVars is Ownable {
    /// @notice weth token address
    address public weth;

    /// @notice address of the Compound comptroller contract.
    Comptroller public comptroller;

    /// @notice address of the KeeperDAO's kComptroller contract.
    IKComptroller public kComptroller;

    /// @notice address of the KeeperDAO's kCompound contract.
    ERC721 public kCompound;

    /// @notice list of supported cERC20s.
    CErc20[] public cERC20s;

    /// @notice cEther contract address.
    CEther public cEther;

    /// @notice address of the KeeperDAO's liquidityPool contract.
    address payable public jitu;

    /// @notice underlying address to cERC20 token map.
    mapping (address=>CErc20) public cTokenMap;

    address[] _cTokens;

    constructor (
        address _weth, 
        Comptroller _comptroller, 
        CEther _cEther, 
        CErc20[] memory _cERC20s,
        IKComptroller _kComptroller, 
        address payable _jitu,
        ERC721 _kCompound
    ) {
        require(_weth != address(0), "CompoundMigrator: WETH should not be 0x0");
        require(_comptroller != Comptroller(0), "CompoundMigrator: Comptroller should not be 0x0");
        require(_cEther != CEther(0), "CompoundMigrator: cEther should not be 0x0");
        weth = _weth;
        comptroller = _comptroller;
        cEther = _cEther;
        kComptroller = _kComptroller;
        jitu = _jitu;
        kCompound = _kCompound;

        _cTokens.push(address(_cEther));
        for (uint16 i = 0; i < _cERC20s.length; i++) {
            addCERC20(_cERC20s[i]);
        }
    }

    /// @notice allows the owner of this contract to
    /// update the JITU.
    function updateJITU(address payable _newJITU) external onlyOwner {
        require(_newJITU != address(0), "CompoundVars: JITU cannot be 0x0");
        jitu = _newJITU;
    }

    /// @notice allows the owner of this contract to
    /// update the KComptroller.
    function updateKComptroller(IKComptroller _kComptroller) external onlyOwner {
        require(_kComptroller != IKComptroller(0), "CompoundVars: KComptroller cannot be 0x0");
        kComptroller = _kComptroller;
    }

    /// @notice allows the owner of this contract to
    /// update the KCompound.
    function updateKCompound(ERC721 _kCompound) external onlyOwner {
        require(_kCompound != ERC721(0), "CompoundVars: KCompound cannot be 0x0");
        kCompound = _kCompound;
    }

    /// @notice allows the owner of this contract to
    /// update the Comptroller.
    function updateComptroller(Comptroller _comptroller) external onlyOwner {
        require(_comptroller != Comptroller(0), "CompoundVars: Comptroller cannot be 0x0");
        comptroller = _comptroller;
    }

    /// @notice allows the owner of add additional
    /// CERC20 tokens.
    function addCERC20(CErc20 _newCERC20) public onlyOwner {
        require(_newCERC20 != CErc20(0), "CompoundVars: CErc20 cannot be 0x0");
        require(_newCERC20.underlying() != address(0), "CompoundVars: CErc20's underlying address cannot be 0x0");
        require(cTokenMap[_newCERC20.underlying()] == CErc20(0), "CompoundVars: CErc20 already listed");

        cERC20s.push(_newCERC20);
        cTokenMap[_newCERC20.underlying()] = _newCERC20;
        _cTokens.push(address(_newCERC20));
    }   

    /// @notice return the list of supported cTokens
    function cTokens() external view returns (address[] memory) {
        return _cTokens;
    }

    /// @notice returns the cToken contract for the given underlying token.
    ///
    /// @param _token the underlying token address.
    ///
    /// @return corresponding cToken address for the given token.
    function cTokenWrapper(address _token) external view returns (CToken) {
        require(_token != address(0), "CompoundVars: token cannot be 0x0");
        CToken cToken;
        if (weth == _token) {
            cToken = cEther;
        } else {
            cToken = cTokenMap[_token];
        }
        require(cToken != CToken(0), "CompoundVars: unsupported token");
        return cToken;
    }
}"
    },
    "contracts/JITU.sol": {
      "content": "// SPDX-License-Identifier: LGPL-3.0-or-later
pragma solidity 0.7.4;

import "keeperdao/contracts/LiquidityPool.sol";

interface Wallet {
    function preempt(address _liquidator, address _repayToken, uint _repayAmount, address _cTokenCollateral) external;

    function underwrite(address _token, uint256 _amount) external;
    function reclaim() external; 

    function checkBufferValue(address _token, uint256 _amount) external;
}

/// @dev this contract extends KeeperDAO's LiquidityPool contract, and users would be able 
///      to deposit supported tokens to this contract. 
/// @dev this contract allows whitelisted keepers to add buffer to compound positions that 
///      are slightly above water, so that in the case they go underwater the keepers can
///      preempt a liquidation.
/// @dev the behaviour of the whitelisted keepers is controlled by the token economics of 
///      KeeperDAO.
contract JITU is LiquidityPoolV3 {
    using SafeMath for uint256;
    using SafeERC20 for ERC20;

    struct BufferProvided {
        address token;
        uint256 amount;
    }

    mapping (address=>BufferProvided[]) buffer;
    mapping (address=>bool) isWhitelistedKeeper;

    modifier onlyWhitelistedKeeper() {
        require(isWhitelistedKeeper[msg.sender], "JITU: caller is not a whitelisted keeper");
        _;
    }

    /// @notice whitelist the given keeper, add to the keeper
    ///         whitelist.
    /// @param _keeper the address of the keeper
    function whitelist(address _keeper) external onlyOperator {
        isWhitelistedKeeper[_keeper] = true;
    }

    /// @notice blacklist the given keeper, remove from the keeper
    ///         whitelist.
    /// @param _keeper the address of the keeper
    function blacklist(address _keeper) external onlyOperator {
        isWhitelistedKeeper[_keeper] = false;
    }

    /// @notice underwrite the given wallet, with the given amount of
    ///         compound tokens
    ///
    /// @param _wallet the address of the compound wallet
    /// @param _token the address of the ERC20 token
    /// @param _amount the amount of ERC20 tokens
    function underwrite(address _wallet, address _token, uint256 _amount) external onlyWhitelistedKeeper nonReentrant whenNotPaused {
        // This function reverts if the buffer being provided exceeds 
        // the max buffer value (which is 25% of the total compound 
        // position).
        Wallet(_wallet).checkBufferValue(_token, _amount);
        ERC20(_token).safeIncreaseAllowance(_wallet, _amount);
        Wallet(_wallet).underwrite(_token, _amount);

        loanedAmount[_token] = loanedAmount[_token].add(_amount);
        buffer[_wallet].push(BufferProvided(_token, _amount));
    }

    /// @notice reclaim the given amount of compound tokens
    ///          from the given wallet 
    ///
    /// @param _wallet the address of the compound wallet
    function reclaim(address _wallet) external onlyWhitelistedKeeper nonReentrant whenNotPaused {
        Wallet(_wallet).reclaim();
        BufferProvided[] memory buffers = buffer[_wallet];
        delete(buffer[_wallet]);
        for (uint i = 0; i < buffers.length; i++) {
            BufferProvided memory bufferProvided = buffers[i];
            loanedAmount[bufferProvided.token] 
                = loanedAmount[bufferProvided.token].sub(bufferProvided.amount);
        }
    }

    /// @notice preempt a liquidation that does a liquidation
    ///         without considering the buffer provided by JITU
    ///
    /// @param _wallet the address of the compound wallet
    /// @param _repayToken the address of the token that needs to be repaid
    /// @param _repayAmount the amount of the token that needs to be repaid
    /// @param _cTokenCollateral the compound token that the user would 
    ///         receive for repaying the loan
    function preempt(Wallet _wallet, address _repayToken, uint _repayAmount, address _cTokenCollateral) external onlyWhitelistedKeeper nonReentrant whenNotPaused {
        _wallet.preempt(msg.sender, _repayToken, _repayAmount, _cTokenCollateral);
    }
}"
    },
    "contracts/gelato/Gelatofied.sol": {
      "content": "// SPDX-License-Identifier: UNLICENSED
pragma solidity 0.7.4;

import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

abstract contract Gelatofied {
    using SafeERC20 for IERC20;

    address public constant ETH = 0xEeeeeEeeeEeEeeEeEeEeeEEEeeeeEeeeeeeeEEeE;
    address payable public immutable gelato;
    address public paymentToken;

    modifier gelatofy(uint256 _amount, address _paymentToken) {
        require(msg.sender == gelato, "Gelatofied: Only gelato");

        _;

        if (_paymentToken == ETH) {
            (bool success, ) = gelato.call{value: _amount}("");
            require(success, "Gelatofied: Gelato fee failed");
        } else {
            IERC20(_paymentToken).safeTransfer(gelato, _amount);
        }
    }

    constructor(address payable _gelato) {
        gelato = _gelato;
        paymentToken = ETH;
    }

    function _setPaymentToken(address _token) internal {
        require(_token != address(0), "Gelatofied: zero address");
        paymentToken = _token;
    }

    function _withdraw(
        address _token,
        address payable _receiver,
        uint256 _amount
    ) internal {
        if (_token == ETH) {
            (bool success, ) = _receiver.call{value: _amount}("");
            require(success, "Gelatofied: eth withdraw failed");
        } else {
            IERC20(_token).safeTransfer(_receiver, _amount);
        }
    }
}
"
